import React from 'react';
import project1Image from '../assets/readhub.png'; 
import project2Image from '../assets/vibetrack.png';
import project3Image from '../assets/ecommerce.png';

function Projects() {
  return (
    <section id="projects">
      <div className="projects-container">
        <div className="project-card">
          <img src={project1Image} alt="Project 1" width="350" />
          <h3>Project 1</h3>
          <p>Description of Project 1</p>
          <a href="#project1">View Project</a>
        </div>
        {/* Add more project cards as needed */}
        <div className="project-card">
          <img src={project2Image} alt="Project 2" width="350"/>
          <h3>Project 2</h3>
          <p>Description of Project 2</p>
          <a href="#project2">View Project</a>
        </div>

        <div className="project-card">
          <img src={project3Image} alt="Project 2" width="350"/>
          <h3>Project 3</h3>
          <p>Description of Project 3</p>
          <a href="#project2">View Project</a>
        </div>
      </div>
    </section>
  );
}

export default Projects;
